'use strict';

// source/compose/builders/builderFunctions.ts
var product = (p) => p;
var feature = (f) => f;
var featureItem = ({
  feature_id,
  included_usage,
  interval,
  reset_usage_when_enabled,
  entity_feature_id
}) => {
  return {
    included_usage,
    feature_id,
    interval,
    reset_usage_when_enabled,
    entity_feature_id
  };
};
var pricedFeatureItem = ({
  feature_id,
  price,
  tiers,
  interval,
  included_usage = void 0,
  billing_units = 1,
  usage_model = "pay_per_use",
  reset_usage_when_enabled,
  entity_feature_id
}) => {
  return {
    price,
    tiers,
    interval,
    billing_units,
    feature_id,
    usage_model,
    included_usage,
    reset_usage_when_enabled,
    entity_feature_id
  };
};
var priceItem = ({
  price,
  interval
}) => {
  return {
    price,
    interval
  };
};

exports.feature = feature;
exports.featureItem = featureItem;
exports.priceItem = priceItem;
exports.pricedFeatureItem = pricedFeatureItem;
exports.product = product;
